.page-changelog .timeline>li {
    position: relative;
    padding-bottom: 15px;
    list-style: none;
    line-height: 1.8;
    border: 1px solid #ddd;
    border-radius: 4px
}

.page-changelog .timeline ul ul li {
    padding-left: 0;
    color: #555;
    word-break: normal
}

.page-changelog .timeline ul ul li:before {
    content: "";
    circle: 4px #fff;
    border: 1px solid #333;
    margin-right: -12px;
    display: inline-block;
    vertical-align: middle
}

.page-changelog .timeline li li {
    font-size: 16px;
    list-style: none;
    padding-left: 20px;
    padding-bottom: 5px;
    color: #333;
    word-break: break-all
}

.page-changelog .timeline li li:before {
    content: "";
    circle: 6px #333;
    transform: translateX(-20px);
    display: inline-block;
    vertical-align: middle
}

.page-changelog .timeline h3 {
    margin: 0;
    padding: 15px 30px;
    border-bottom: 1px solid #ddd;
    font-size: 20px;
    color: #333;
    font-weight: 700
}

.page-changelog .timeline h3 a {
    opacity: 1;
    font-size: 20px;
    float: none;
    margin-left: 0;
    color: #333
}

.page-changelog .timeline h4 {
    margin: 0 0 -10px;
    font-size: 18px;
    padding-left: 54px;
    padding-top: 30px;
    font-weight: 700
}

.page-changelog .timeline em {
    position: absolute;
    right: 30px;
    font-style: normal;
    top: 23px;
    font-size: 16px;
    color: #666
}

